import React from 'react'
import "./Navbar.css"
import BugImg from "../images/bug.svg"

const Navbar = () => {
  return (
    <div className='top-wrapper'>
        <div className='nav-left'></div>
        <div className='nav-left'><img src={BugImg} className='Bug-image' alt='Bug' /> <h1 className='header-name'>Bug Tracker</h1></div>
        <div className='nav-left'></div>

    </div>
  )
}

export default Navbar
